<body>
  <script type="module">
    window.__SHB_API__ = {
      get_name : () => {
      return "WEOEW";
    }
    }
    import { default as wasm, greet, shb_to_html } from "./pkg/shibim_js.js";
    wasm().then((module) => {
      greet();
      window.__SHB_API__.shb_to_html = shb_to_html;
      window.__SHB_API__.greet = greet;
    });


  </script>
  <script>
    async function demo(sqlite3) {
      let array = await (await sqlite_db).arrayBuffer();
      console.log(array);
      let log = console.log;
      const oo = sqlite3.oo1;
      const p = sqlite3.wasm.allocFromTypedArray(array);
      const db = new oo.DB();
      //see note on allocators (https://sqlite.org/wasm/doc/trunk/api-c-style.md#sqlite3_deserialize)
      const rc = sqlite3.capi.sqlite3_deserialize(
        db.pointer, 'main', p, array.byteLength, array.byteLength,
        sqlite3.capi.SQLITE_DESERIALIZE_FREEONCLOSE | sqlite3.capi.SQLITE_DESERIALIZE_RESIZEABLE
      );
      db.checkRc(rc);
      log("transient db =", db.filename);
      try {
        log("Create a table...");
        db.exec("CREATE TABLE IF NOT EXISTS t(a,b)");
        //Equivalent:
        db.exec({
          sql: "CREATE TABLE IF NOT EXISTS t(a,b)"
          // ... numerous other options ... 
        });
        // SQL can be either a string or a byte array
        // or an array of strings which get concatenated
        // together as-is (so be sure to end each statement
        // with a semicolon).

        log("Insert some data using exec()...");
        let i;
        for (i = 20; i <= 25; ++i) {
          db.exec({
            sql: "insert into t(a,b) values (?,?)",
            // bind by parameter index...
            bind: [i, i * 2]
          });
          db.exec({
            sql: "insert into t(a,b) values ($a,$b)",
            // bind by parameter name...
            bind: { $a: i * 10, $b: i * 20 }
          });
        }

        log("Insert using a prepared statement...");
        let q = db.prepare([
          // SQL may be a string or array of strings
          // (concatenated w/o separators).
          "insert into t(a,b) ",
          "values(?,?)"
        ]);
        try {
          for (i = 100; i < 103; ++i) {
            q.bind([i, i * 2]).step();
            q.reset();
          }
          // Equivalent...
          for (i = 103; i <= 105; ++i) {
            q.bind(1, i).bind(2, i * 2).stepReset();
          }
        } finally {
          q.finalize();
        }

        log("Query data with exec() using rowMode 'array'...");
        db.exec({
          sql: "select name from songs",
          rowMode: 'array', // 'array' (default), 'object', or 'stmt'
          callback: function (row) {
            log("row ", ++this.counter, "=", row);
          }.bind({ counter: 0 })
        });
      } finally {
        db.close()
      }
    }
    addEventListener("load", (event) => {
      self.sqlite3InitModule({
        // We can redirect any stdout/stderr from the module
        // like so...
        print: console.log,
        printErr: console.error
      }).then(async function (sqlite3) {
        //console.log('sqlite3 =',sqlite3);
        console.log("Done initializing. Running demo...");
        try {
          demo(sqlite3);
        } catch (e) {
          console.error("Exception:", e.message);
        }
      })
    });
  </script>
